/*{material index,face count}*/
static int material_ref[2][2]=
{
    {0, 41796},
    {1,  1004}
};

GLfloat nSize = 0.0f;
GLfloat nCol = 0.0f;
GLfloat nTop = 1.0f;
GLfloat nBottom = 0.0f;

GLfloat pvertices[ATHENE_TRIANGLES*3*3];
GLfloat pnormals[ATHENE_TRIANGLES*3*3];
GLint   segments[3];
GLint   segment_id=0;

void app_init(int width, int height)
{
    int vtx_count=0;
    int mcount=0;
    int mindex=0;
    int i;
    int j;

    GLfloat gldAspect;
    GLfloat glfLightAmbient[]={0.1f, 0.1f, 0.1f, 1.0f};
    GLfloat glfLightDiffuse[]={1.2f, 1.2f, 1.2f, 1.0f};
    GLfloat glfLightSpecular[]={0.9f, 0.9f, 0.9f, 1.0f};

    gldAspect=(GLfloat)width/(GLfloat)height;

    glMatrixMode(GL_PROJECTION);
    glLoadIdentity();
    gluPerspective(30.0, gldAspect, 1.0, 10.0);
    glViewport(0, 0, width, height);

    glClearColor(0.6f, 0.5f, 0.4f, 1.0f);

    /*                            */
    /* Add a light to the scene.  */
    /*                            */

    glLightfv(GL_LIGHT0, GL_AMBIENT, glfLightAmbient);
    glLightfv(GL_LIGHT0, GL_DIFFUSE, glfLightDiffuse);
    glLightfv(GL_LIGHT0, GL_SPECULAR, glfLightSpecular);
    glEnable(GL_LIGHTING);
    glEnable(GL_LIGHT0);

    /*                                            */
    /* Enable depth testing and backface culling. */
    /*                                            */

    glEnable(GL_DEPTH_TEST);
    glEnable(GL_CULL_FACE);

    for(i=0; i<sizeof(face_indicies)/sizeof(face_indicies[0]); i++)
    {
        if (!mcount)
        {
            segments[segment_id]=vtx_count;
            segment_id++;
            mcount=material_ref[mindex][1];
            mindex++;
        }
        mcount--;
        vtx_count++;

        for(j=0; j<3; j++)
        {
            int vi=face_indicies[i][j];
            int ni=face_indicies[i][j+3];

            pnormals[i*9+j*3+0]=normals[ni][0];
            pnormals[i*9+j*3+1]=normals[ni][1];
            pnormals[i*9+j*3+2]=normals[ni][2];
            pvertices[i*9+j*3+0]=vertices[vi][0];
            pvertices[i*9+j*3+1]=vertices[vi][1];
            pvertices[i*9+j*3+2]=vertices[vi][2];
        }
    }
    segments[segment_id]=vtx_count;

    fprintf(stdout, "Athene statue\n");
    fprintf(stdout, "    Vertices:  %d\n", ATHENE_TRIANGLES*3);
    fprintf(stdout, "    Normals:   %d\n", ATHENE_TRIANGLES*3);
    fprintf(stdout, "    Triangles: %d\n\n", ATHENE_TRIANGLES);
}

void MyMaterial(GLenum mode, GLfloat* f, GLfloat alpha)
{
     GLfloat d[4];

     d[0]=f[0];
     d[1]=f[1];
     d[2]=f[2];
     d[3]=alpha;
     glMaterialfv(GL_FRONT_AND_BACK, mode, d);
}

/*
 *  SelectMaterial uses OpenGL commands to define facet colors.
 *
 *  Returns:
 *    Nothing
 */

void SelectMaterial(int i)
{
    /*                                                          */
    /* Define the reflective properties of the 3D Object faces. */
    /*                                                          */

    GLfloat alpha=materials[i].alpha;
    MyMaterial(GL_AMBIENT, materials[i].ambient,alpha);
    MyMaterial(GL_DIFFUSE, materials[i].diffuse,alpha);
    MyMaterial(GL_SPECULAR, materials[i].specular,alpha);
    MyMaterial(GL_EMISSION, materials[i].emission,alpha);
    glMaterialf(GL_FRONT_AND_BACK, GL_SHININESS, materials[i].phExp);

    if (alpha<1.0f)
    {
        glEnable(GL_BLEND);
        glDisable(GL_DEPTH_TEST);
        glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
        glColor4f(1.0f, 1.0f, 1.0f, alpha);
    }
    else
    {
        glDisable(GL_BLEND);
        glEnable(GL_DEPTH_TEST);
    }
}

/*
 *  DrawScene uses OpenGL commands to draw a object.
 *
 *  Input parameters:
 *    hdc = Device context handle
 *    nAngle = Angle of rotation for object
 *
 *  Returns:
 *    Nothing
 */

static unsigned int nAngle=0;
static unsigned int nAngle2=0;
static unsigned int nAngle3=0;
static int bFlag=1;

void app_draw()
{
    int i;

    //
    // Clear the color and depth buffers.
    //
    glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);

    //
    // Define the modelview transformation.
    //
    glMatrixMode(GL_MODELVIEW);
    glLoadIdentity();
    glTranslatef(0.0f, 0.0f, -5.0f+nSize+2.5f);
    glRotatef(270.0f, 1.0f, 0.0f, 0.0f);
    glRotatef((GLfloat)nAngle, 0.0f, 1.0f, 0.0f);
    glRotatef((GLfloat)nAngle2, 1.0f, 0.0f, 0.0f);
    glRotatef((GLfloat)nAngle3, 0.0f, 0.0f, 1.0f);

    glEnableClientState(GL_NORMAL_ARRAY);
    glEnableClientState(GL_VERTEX_ARRAY);
    glNormalPointer(GL_FLOAT, 0, pnormals);
    glVertexPointer(3, GL_FLOAT, 0, pvertices);

    for (i=0; i<segment_id; i++)
    {
        SelectMaterial(material_ref[i][0]);
        glDrawArrays(GL_TRIANGLES, segments[i]*3, (segments[i+1]-segments[i])*3);
    }

    glDisableClientState(GL_NORMAL_ARRAY);
    glDisableClientState(GL_VERTEX_ARRAY);

    glFlush();

    nAngle += 2;
    if (nAngle >= 360)
        nAngle -= 360;
    nAngle2 += 1;
    if (nAngle2 >= 360)
        nAngle2 -= 360;
    nAngle3 += 3;
    if (nAngle3 >= 360)
        nAngle3 -= 360;

    if (bFlag == 1)
        nSize += 0.05f;
    nCol += 0.01f;
    if (nSize >= nTop)
        bFlag = 0;

    if (bFlag == 0)
        nSize -= 0.05f;
        nCol -= 0.01f;
    if (nSize <= nBottom)
        bFlag = 1;
};

